  KEY `CUSTOMERS_CARD_INX` (`CARD`),
  CONSTRAINT `CUSTOMERS_TAXCAT` FOREIGN KEY (`TAXCATEGORY`) REFERENCES `TAXCUSTCATEGORIES` (`ID`)
